export default function Header() {
  return (
    <div className="header">
      <div className="headerTitles">
        <span className="headerTitleSm"></span>
        <span className="headerTitleLg">Blog<b style={{"color" : "#FE40B9"}}>G</b>ers</span>
      </div>
      <img 
        className="headerImg" 
        src="./assets/headerImg.jpg" 
        alt="" 
      />
    </div>
  );
}
